import ExpenseItem from "./components/ExpenseItem";

function App() {
  const expenses = [
    {
      id: "e1",
      title: "Toilet Paper",
      amount: 67.5,
      date: new date()
    },
    {
      id: "e2",
      title: "Plates",
      amount: 12.5,
      date: new date()
    },
    {
      id: "e3",
      title: "Paper Bags",
      amount: 89.4,
      date: new date()
    },
  ]
  return (
    <div>
      <h1>Let's get started!</h1>
      <ExpenseItem 
      title={expenses[0].title} 
      date={expenses[0].date} 
      amount={expenses[0].amount}>
      </ExpenseItem>
      <ExpenseItem 
      title ={expenses[1].title} date={expenses[1].date} amount={expenses[1].amount}></ExpenseItem>
      <ExpenseItem title ={expenses[2].title} date={expenses[2].date} amount={expenses[2].amount}></ExpenseItem>

    </div>
  );
}

export default App;
